import React, { useState } from "react";
import InputField from "./InputField";
import SelectField from "./SelectField";
import { educationOptions } from "../constants/form";
import Section from "./Section";
import { sendDetails } from "../api";
import {
  SchemaTypes,
  formatObject,
  formatValue,
  resolver,
  validateData,
} from "../utils";

const defaultForm = {
  email: "",
  fullName: "",
  age: "",
  education: "",
  institute: "",
  program: "",
  experience: "",
  canadaInstitute: "",
  canadaProgram: "",
  country: "",
  goals: "",
  scoresListening: "",
  scoresReading: "",
  scoresSpeaking: "",
  scoresWriting: "",
  isPaidTutionFees: null,
  paidTutionAmount: "",
  isGic: null,
  paidGicAmout: "",
};

const schema = {
  email: SchemaTypes.string(true),
  fullName: SchemaTypes.string(true),
  age: SchemaTypes.number(true),
  education: SchemaTypes.string(true),
  institute: SchemaTypes.string(true),
  program: SchemaTypes.string(true),
  experience: SchemaTypes.string(true),
  canadaInstitute: SchemaTypes.string(true),
  canadaProgram: SchemaTypes.string(true),
  country: SchemaTypes.string(true),
  goals: SchemaTypes.string(true),
  scoresListening: SchemaTypes.number(true),
  scoresReading: SchemaTypes.number(true),
  scoresSpeaking: SchemaTypes.number(true),
  scoresWriting: SchemaTypes.number(true),
  isPaidTutionFees: SchemaTypes.boolean(true),
  paidTutionAmount: SchemaTypes.number(true),
  isGic: SchemaTypes.boolean(true),
  paidGicAmout: SchemaTypes.number(true),
};

export default function Form() {
  const [form, setForm] = useState(defaultForm);
  const { format, validate } = resolver(schema, form);

  const handleChange = (value, name) => {
    setForm((prevState) => ({ ...prevState, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log(validate(), "errors");
    console.log(format(), "formatted");

    // sendDetails(form);
  };

  const errors = validate();

  return (
    <div className="container">
      <form onSubmit={handleSubmit}>
        <Section>
          <InputField
            label="Email"
            name="email"
            type="email"
            value={form.email}
            onChange={handleChange}
            errors={errors}
          />
        </Section>
        <Section>
          <InputField
            label="Full Name"
            name="fullName"
            type="text"
            value={form.fullName}
            onChange={handleChange}
            errors={errors}
          />
        </Section>

        <Section>
          <InputField
            label="Age"
            name="age"
            type="number"
            value={form.age}
            onChange={handleChange}
            errors={errors}
          />
        </Section>

        <Section>
          <SelectField
            label="Highest Level of Education"
            name="education"
            options={educationOptions}
            value={form.education}
            onChange={handleChange}
            errors={errors}
          />
        </Section>

        <Section>
          <InputField
            label="What did you study?"
            name="program"
            type="text"
            value={form.program}
            onChange={handleChange}
            errors={errors}
          />
        </Section>

        <Section>
          <InputField
            label="Institute"
            name="institute"
            type="text"
            value={form.institute}
            onChange={handleChange}
            errors={errors}
          />
        </Section>

        <Section>
          <>
            Do you have any relevant work experience? *
            <br /> Write None if no work experience. Provide the following
            details if yes:
            <ol>
              <li>Job Title</li>
              <li>Company Name</li>
              <li>Job duties</li>
            </ol>
            Sample Answer: I worked as a Sales Manager at Effizient Immigration
            Inc from Jan 2022 till Feb 2023. In this role, I managed sales
            operations, reaching out to leads, lead the outreach program,
            ensured meeting monthly targets.
          </>
          <InputField
            name="experience"
            type="text"
            value={form.experience}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="What institute did you get admitted to in Canada?"
            name="canadaInstitute"
            type="text"
            value={form.canadaInstitute}
            onChange={handleChange}
          />
        </Section>
        <Section>
          <InputField
            label="What is your program of study in Canada?"
            name="canadaProgram"
            type="text"
            value={form.canadaProgram}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="Which country are you applying from?"
            name="country"
            type="text"
            value={form.country}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="What are your future goals?"
            name="goals"
            type="text"
            value={form.goals}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="English Scores - Listening"
            name="scoresListening"
            type="number"
            value={form.scoresListening}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="English Scores - Reading"
            name="scoresReading"
            type="number"
            value={form.scoresReading}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="English Scores - Speaking"
            name="scoresSpeaking"
            type="number"
            value={form.scoresSpeaking}
            onChange={handleChange}
          />
        </Section>
        <Section>
          <InputField
            label="English Scores - Writing"
            name="scoresWriting"
            type="number"
            value={form.scoresWriting}
            onChange={handleChange}
          />
        </Section>
        <Section>
          <InputField
            label="Did you pay your first year tuition?"
            name="isPaidTutionFees"
            type="radio"
            value={form.isPaidTutionFees}
            onChange={handleChange}
          />
        </Section>
        <Section>
          <InputField
            label="How much tuition fee did you pay?"
            name="paidTutionAmount"
            type="number"
            value={form.paidTutionAmount}
            onChange={handleChange}
          />
        </Section>

        <Section>
          <InputField
            label="Did you do a GIC?"
            name="isGic"
            type="radio"
            value={form.isGic}
            onChange={handleChange}
          />
        </Section>
        <Section>
          <InputField
            label="How much did you pay towards GIC?"
            name="paidGicAmout"
            type="number"
            value={form.paidGicAmout}
            onChange={handleChange}
          />
        </Section>
        <input type="submit" />
      </form>
    </div>
  );
}
